import { Link } from "react-router-dom";

const Complete = () => {
  const [isGenerate, setGenerate] = useState(false);
  return (
    <>
      {isGenerate || (
        <>
          <p>generating...</p>
          <div class="loader">Loading...</div>
        </>  
      )}
      {isGenerate && (
        <>
          <p>true</p>
        </>
      )}
    </>
  );
}

export default Complete;
